WITH filtered_dates AS (SELECT d_date_sk FROM date_dim WHERE d_month_seq BETWEEN 1200 AND 1200 + 11), warehouse_substr AS (SELECT SUBSTRING(w_warehouse_name, 1, 20) AS w_substr, w_warehouse_sk FROM warehouse)
SELECT ws.w_substr, sm.sm_type, web.web_name, SUM(CASE WHEN (ws_ship_date_sk - ws_sold_date_sk <= 30) THEN 1 ELSE 0 END) AS "30 days", SUM(CASE WHEN (ws_ship_date_sk - ws_sold_date_sk > 30) AND (ws_ship_date_sk - ws_sold_date_sk <= 60) THEN 1 ELSE 0 END) AS "31-60 days", SUM(CASE WHEN (ws_ship_date_sk - ws_sold_date_sk > 60) AND (ws_ship_date_sk - ws_sold_date_sk <= 90) THEN 1 ELSE 0 END) AS "61-90 days", SUM(CASE WHEN (ws_ship_date_sk - ws_sold_date_sk > 90) AND (ws_ship_date_sk - ws_sold_date_sk <= 120) THEN 1 ELSE 0 END) AS "91-120 days", SUM(CASE WHEN (ws_ship_date_sk - ws_sold_date_sk > 120) THEN 1 ELSE 0 END) AS ">120 days" FROM (SELECT ws.*, ws.ws_ship_date_sk - ws.ws_sold_date_sk AS shipping_days FROM web_sales AS ws JOIN filtered_dates AS fd ON ws.ws_ship_date_sk = fd.d_date_sk) AS ws JOIN warehouse_substr AS ws_sub ON ws.ws_warehouse_sk = ws_sub.w_warehouse_sk JOIN ship_mode AS sm ON ws.ws_ship_mode_sk = sm.sm_ship_mode_sk JOIN web_site AS web ON ws.ws_web_site_sk = web.web_site_sk GROUP BY ws_sub.w_substr, sm.sm_type, web.web_name ORDER BY 1 NULLS FIRST, 2 NULLS FIRST, 3 NULLS FIRST LIMIT 100